import React from "react";

const ProgrammingSkills = ({ programming }) => {
    return (
        <li>
            <div>
            <p className="p-item2">
                {programming.language}
                    <div className={`programming-item ${programming.id}`}>

                    </div>
            </p>
            </div>
        </li>
    )
}

export default ProgrammingSkills;
